import React, {Component} from "react";

function Succes(){
    state = {
        items: [
            {
                id:1,
                title: 'horloge',
                waarde: 300
            },
            {
                id:2,
                title: 'auto',
                waarde: 18000
            },
            {
                id:3,
                title: 'huis',
                waarde: 400000
            }
        ]
    }

   
    return(
        <div>
            <h1>Dit is een test</h1>
        </div>
    );
}

export default Succes;
